       (85, 'EXCHANGE_RATE_CONFIG', '{\"currencyLocal\":1,\"currencyUsd\":0.1529}', '汇率配置'),
        (86,'SERVICE_POLICY_CONFIG_1','{\"content\":\"<h3 style=\\\"text-align: center, background: #ffffff, margin: 15.0000pt 10.5000pt 7.5000pt 10.5000pt,\\\" align=\\\"center\\\" data-mce-fragment=\\\"1\\\"><strong data-mce-fragment=\\\"1\\\"><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #333333, font-weight: bold, font-size: 20.0000pt, mso-font-kerning: 1.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">隐私政策</span></span></strong></h3>\\n<p class=\\\"p\\\" style=\\\"margin-top: 0.0000pt, margin-bottom: 7.5000pt, text-indent: 24.0000pt, background: #ffffff,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #333333, font-size: 10.0000pt, mso-font-kerning: 0.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">&nbsp,</span></span></p>\\n<p class=\\\"p\\\" style=\\\"margin-top: 0.0000pt, margin-bottom: 7.5000pt, text-indent: 24.0000pt, background: #ffffff,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #333333, font-size: 10.0000pt, mso-font-kerning: 0.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">本站（以下亦称</span><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">&ldquo,我们&rdquo,）深知个人信息对您的重要性，我们尊重并保护所有使用我们平台服务的用户的个人信息，并会尽全力保护您的个人信息安全可靠。我们致力于维持您对我们的信任，恪守以下原则，保护您的个人信息：权责一致原则、目的明确原则、选择同意原则、最少够用原则、确保安全原则、主体参与原则、公开透明原则等。同时，我们承诺，我们将按业界成熟的安全标准，采取相应的安全保护措施来保护您的个人信息。请在使用我们的产品（或服务）前，仔细阅读并了解本《我们隐私政策》（下称&ldquo,本隐私政策&rdquo,）。</span></span></p>\\n<p class=\\\"p\\\" style=\\\"margin-top: 0.0000pt, margin-bottom: 7.5000pt, text-indent: 24.0000pt, background: #ffffff,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #333333, font-size: 10.0000pt, mso-font-kerning: 0.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">&nbsp,</span></span></p>\\n<p class=\\\"p\\\" style=\\\"margin-top: 0.0000pt, margin-bottom: 7.5000pt, background: #ffffff,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #333333, font-size: 10.0000pt, mso-font-kerning: 0.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">一、我们处理个人信息的法律依据</span></span></p>\\n<p class=\\\"p\\\" style=\\\"margin-top: 0.0000pt, margin-bottom: 7.5000pt, text-indent: 24.0000pt, background: #ffffff,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #333333, font-size: 10.0000pt, mso-font-kerning: 0.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">本隐私政策制定的法律依据为《中华人民共和国消费者权益保护法》、《中华人民共和国网络安全法》、《中华人民共和国电子商务法》、《信息安全技术个人信息安全规范》以及其他涉及公民个人信息的相关法律法规。通常，我们会基于本隐私政策提示的功能收集您的个人信息。某些情况下，如果涉及其他信息的收集我们会单独向您出示个人信息保护说明条款。</span></span></p>\\n<p class=\\\"p\\\" style=\\\"margin-top: 0.0000pt, margin-bottom: 7.5000pt, background: #ffffff,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #333333, font-size: 10.0000pt, mso-font-kerning: 0.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">二、本隐私政策的适用范围</span></span></p>\\n<p class=\\\"p\\\" style=\\\"margin-top: 0.0000pt, margin-bottom: 7.5000pt, text-indent: 24.0000pt, background: #ffffff,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #333333, font-size: 10.0000pt, mso-font-kerning: 0.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">本隐私政策适用于您使用本平台的产品或服务时使用。</span></span></p>\\n<p class=\\\"p\\\" style=\\\"margin-top: 0.0000pt, margin-bottom: 7.5000pt, background: #ffffff,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #333333, font-size: 10.0000pt, mso-font-kerning: 0.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">三、我们如何收集和使用您的个人信息</span></span></p>\\n<p class=\\\"p\\\" style=\\\"margin-top: 0.0000pt, margin-bottom: 7.5000pt, text-indent: 24.0000pt, background: #ffffff,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #333333, font-size: 10.0000pt, mso-font-kerning: 0.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">个人信息是指以电子或者其他方式记录的能够单独或者与其他信息结合识别特定自然人身份或者反映特定自然人活动情况的各种信息。</span></span></p>\\n<p class=\\\"p\\\" style=\\\"margin-top: 0.0000pt, margin-bottom: 7.5000pt, text-indent: 24.0000pt, background: #ffffff,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #333333, font-size: 10.0000pt, mso-font-kerning: 0.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">个人敏感信息是指一旦泄露、非法提供或滥用可能危害人身和财产安全，极易导致个人名誉、身心健康受到损害或歧视性待遇等的个人信息。在您向我们提供任何属于敏感信息的个人信息前，请您清楚考虑提供是恰当的并且同意您的个人敏感信息可按本隐私政策所述的目的和方式进行处理。我们会在得到您的同意后收集和使用您的敏感信息以实现与我们业务相关的功能，并允许您对这些敏感信息的收集与使用做出不同意的选择，但是拒绝使用这些信息会影响您使用相关功能。</span></span></p>\\n<p class=\\\"p\\\" style=\\\"margin-top: 0.0000pt, margin-bottom: 7.5000pt, text-indent: 24.0000pt, background: #ffffff,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #333333, font-size: 10.0000pt, mso-font-kerning: 0.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">原则上，我们仅会出于本隐私政策所述的以下目的，收集和使用您的个人信息，如果超过以下目的收集和使用您的个人信息时我们会单独向您提示并征得您的同意。</span></span></p>\\n<p class=\\\"p\\\" style=\\\"margin-top: 0.0000pt, margin-bottom: 7.5000pt, margin-left: 0.0000pt, mso-para-margin-left: 0.0000gd, text-indent: 21.0000pt, mso-char-indent-count: 0.0000, background: #ffffff, mso-list: l2 level1 lfo1,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑, color: #333333, font-size: 10.0000pt, mso-font-kerning: 0.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"mso-list: Ignore,\\\" data-mce-fragment=\\\"1\\\">（一）</span></span><!--[endif]--><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #333333, font-size: 10.0000pt, mso-font-kerning: 0.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">帮助您成为我们的注册</span><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">\\\\登录用户</span></span></p>\\n<p class=\\\"p\\\" style=\\\"mso-para-margin-right: 0.0000gd, mso-para-margin-left: 2.0000gd, background: #ffffff, margin: 0.0000pt 0.0000pt 7.5000pt 21.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #333333, font-size: 10.0000pt, mso-font-kerning: 0.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">您自行注册成为我们的用户</span></span></p>\\n<p class=\\\"p\\\" style=\\\"margin-top: 0.0000pt, margin-bottom: 7.5000pt, margin-left: 19.9500pt, mso-para-margin-left: 1.9000gd, text-indent: 0.0000pt, mso-char-indent-count: 0.0000, background: #ffffff,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #333333, font-size: 10.0000pt, mso-font-kerning: 0.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">您在使用我们提供的服务时，首先需要成为我们的注册</span><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">\\\\登录用户。当您注册我们账户时，您需要向我们提供您准备使用的用户名及您本人的手机号码，当您的账户密码遗失时，可以通过注册</span></span><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #333333, font-size: 10.0000pt, mso-font-kerning: 0.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">手机号码</span></span><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #333333, font-size: 10.0000pt, mso-font-kerning: 0.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">发送的链接重置密码。</span></span></p>\\n<p class=\\\"p\\\" style=\\\"margin-top: 0.0000pt, margin-bottom: 7.5000pt, margin-left: 19.9500pt, mso-para-margin-left: 1.9000gd, text-indent: 2.7000pt, mso-char-indent-count: 0.2700, background: #ffffff,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #333333, font-size: 10.0000pt, mso-font-kerning: 0.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">您可自行创建用户名，用户名的命名及使用应遵守相关法律法规并符合网络道德。用户名中不能含有任何侮辱、威胁、淫秽、谩骂等侵害他人合法权益的文字。用户名将作为您在平台上活动的标识，用以区别平台上其他用户。</span></span></p>\\n<p class=\\\"p\\\" style=\\\"margin-top: 0.0000pt, margin-bottom: 7.5000pt, margin-left: 19.9500pt, mso-para-margin-left: 1.9000gd, text-indent: 2.7000pt, mso-char-indent-count: 0.2700, background: #ffffff,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #333333, font-size: 10.0000pt, mso-font-kerning: 0.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">您提供的上述信息，将在您使用我们服务期间持续授权我们使用。在您注销账号时，我们将停止使用并删除上述信息。</span></span></p>\\n<p class=\\\"p\\\" style=\\\"margin-top: 0.0000pt, margin-bottom: 7.5000pt, mso-para-margin-left: 2.0000gd, background: #ffffff,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #333333, font-size: 10.0000pt, mso-font-kerning: 0.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">（二）客户服务</span></span></p>\\n<p class=\\\"p\\\" style=\\\"margin-top: 0.0000pt, margin-bottom: 7.5000pt, margin-left: 19.9500pt, mso-para-margin-left: 1.9000gd, text-indent: 2.7000pt, mso-char-indent-count: 0.2700, background: #ffffff,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #333333, font-size: 10.0000pt, mso-font-kerning: 0.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">当您向我们申诉或进行咨询时，为了方便与您联系或帮助您解决问题，我们可能需要您提供用户名、手机号码信息。如您拒绝提供上述信息，可能部分功能无法使用，同时无法向您及时反馈申诉或咨询结果。</span></span></p>\\n<p class=\\\"p\\\" style=\\\"margin-top: 0.0000pt, margin-bottom: 7.5000pt, margin-left: 19.9500pt, mso-para-margin-left: 1.9000gd, text-indent: 2.7000pt, mso-char-indent-count: 0.2700, background: #ffffff,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #333333, font-size: 10.0000pt, mso-font-kerning: 0.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">会员在本平台删除账号或后期不继续使用，注销账号时会员可以通过</span></span><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #333333, font-size: 10.0000pt, mso-font-kerning: 0.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">个人中心</span><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">-系统设置-注销账号。</span></span></p>\\n<p class=\\\"p\\\" style=\\\"margin-top: 0.0000pt, margin-bottom: 7.5000pt, mso-para-margin-left: 2.0000gd, background: #ffffff,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #333333, font-size: 10.0000pt, mso-font-kerning: 0.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">（三）征得授权同意的例外</span></span></p>\\n<p class=\\\"p\\\" style=\\\"margin-top: 0.0000pt, margin-bottom: 7.5000pt, margin-left: 19.9500pt, mso-para-margin-left: 1.9000gd, text-indent: 2.7000pt, mso-char-indent-count: 0.2700, background: #ffffff,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #333333, font-size: 10.0000pt, mso-font-kerning: 0.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">根据相关法律法规的规定，在以下情形中，我们可以在不征得您的授权同意的情况下收集、使用一些必要的个人信息：</span></span></p>\\n<p class=\\\"p\\\" style=\\\"margin-top: 0.0000pt, margin-bottom: 7.5000pt, margin-left: 0.0000pt, mso-para-margin-left: 0.0000gd, text-indent: 22.7000pt, mso-char-indent-count: 0.0000, background: #ffffff, mso-list: l1 level1 lfo2,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑, color: #333333, font-size: 10.0000pt, mso-font-kerning: 0.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"mso-list: Ignore,\\\" data-mce-fragment=\\\"1\\\">1.&nbsp,</span></span><!--[endif]--><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #333333, font-size: 10.0000pt, mso-font-kerning: 0.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">与公共安全、公共卫生、重大公共利益直接相关的；</span></span></p>\\n<p class=\\\"p\\\" style=\\\"margin-top: 0.0000pt, margin-bottom: 7.5000pt, margin-left: 0.0000pt, mso-para-margin-left: 0.0000gd, text-indent: 22.7000pt, mso-char-indent-count: 0.0000, background: #ffffff, mso-list: l1 level1 lfo2,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑, color: #333333, font-size: 10.0000pt, mso-font-kerning: 0.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"mso-list: Ignore,\\\" data-mce-fragment=\\\"1\\\">2.&nbsp,</span></span><!--[endif]--><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #333333, font-size: 10.0000pt, mso-font-kerning: 0.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">出于维护您或其他个人的生命、财产等重大合法权益但又很难得到本人同意的；</span></span></p>\\n<p class=\\\"p\\\" style=\\\"margin-top: 0.0000pt, margin-bottom: 7.5000pt, margin-left: 0.0000pt, mso-para-margin-left: 0.0000gd, text-indent: 22.7000pt, mso-char-indent-count: 0.0000, background: #ffffff, mso-list: l1 level1 lfo2,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑, color: #333333, font-size: 10.0000pt, mso-font-kerning: 0.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"mso-list: Ignore,\\\" data-mce-fragment=\\\"1\\\">3.&nbsp,</span></span><!--[endif]--><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #333333, font-size: 10.0000pt, mso-font-kerning: 0.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">法律法规规定的其他情形。</span></span></p>\\n<p class=\\\"p\\\" style=\\\"margin-top: 0.0000pt, margin-bottom: 7.5000pt, background: #ffffff,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #333333, font-size: 10.0000pt, mso-font-kerning: 0.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">四、我们如何保护您的个人信息</span></span></p>\\n<p class=\\\"p\\\" style=\\\"margin-top: 0.0000pt, margin-bottom: 7.5000pt, text-indent: 24.0000pt, background: #ffffff,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #333333, font-size: 10.0000pt, mso-font-kerning: 0.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">为保障您的信息安全，我们努力采取各种合理的物理、电子和管理方面的安全措施来保护您的信息，使您的信息不会被泄漏、毁损或者丢失，包括但不限于</span><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">SSL、信息加密存储、数据中心的访问控制。</span></span></p>\\n<p class=\\\"p\\\" style=\\\"margin-top: 0.0000pt, margin-bottom: 7.5000pt, text-indent: 24.0000pt, background: #ffffff,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #333333, font-size: 10.0000pt, mso-font-kerning: 0.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">数据加密：我们对于用户的用户名、手机号进行加密存储，保证用户基本信息不会被恶意获取；</span></span></p>\\n<p class=\\\"p\\\" style=\\\"margin-top: 0.0000pt, margin-bottom: 7.5000pt, text-indent: 24.0000pt, background: #ffffff,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #333333, font-size: 10.0000pt, mso-font-kerning: 0.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">身份鉴别：我们通过校验账号密码或者账号绑定</span></span><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #333333, font-size: 10.0000pt, mso-font-kerning: 0.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">的</span></span><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #333333, font-size: 10.0000pt, mso-font-kerning: 0.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">手机</span></span><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #333333, font-size: 10.0000pt, mso-font-kerning: 0.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">号码</span></span><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #333333, font-size: 10.0000pt, mso-font-kerning: 0.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">，进行用户身份合法性鉴别，防止非经授权的介入；</span></span></p>\\n<p class=\\\"p\\\" style=\\\"margin-top: 0.0000pt, margin-bottom: 7.5000pt, margin-left: 22.7000pt, mso-para-margin-left: 0.0000gd, text-indent: 0.0000pt, mso-char-indent-count: 0.0000, background: #ffffff, mso-list: l4 level1 lfo3,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑, color: #333333, font-size: 10.0000pt, mso-font-kerning: 0.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"mso-list: Ignore,\\\" data-mce-fragment=\\\"1\\\">1.&nbsp,</span></span><!--[endif]--><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #333333, font-size: 10.0000pt, mso-font-kerning: 0.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">账号保护：您的账户均有安全保护功能，请妥善保管您的账户及密码信息。对用户密码进行加密等安全措施确保您的信息不丢失，不被滥用和变造。尽管有前述安全措施，但同时也请您理解，由于技术的限制以及可能存在的各种恶意手段，即便竭尽所能加强安全措施，在信息网络上也不存在</span><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">&ldquo,完善的安全措施&rdquo,。如因您自己的原因导致账户及密码信息泄露而造成的任何法律后果需由您本人负责。</span></span></p>\\n<p class=\\\"p\\\" style=\\\"margin-top: 0.0000pt, margin-bottom: 7.5000pt, margin-left: 22.7000pt, mso-para-margin-left: 0.0000gd, text-indent: 0.0000pt, mso-char-indent-count: 0.0000, background: #ffffff, mso-list: l4 level1 lfo3,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑, color: #333333, font-size: 10.0000pt, mso-font-kerning: 0.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"mso-list: Ignore,\\\" data-mce-fragment=\\\"1\\\">2.&nbsp,</span></span><!--[endif]--><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #333333, font-size: 10.0000pt, mso-font-kerning: 0.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">互联网环境并非百分之百安全，我们将尽力确保或担保您发送给我们的任何信息的安全性。在不幸发生个人信息安全事件后，我们将按照法律法规的要求，及时向您告知：安全事件的基本情况和可能的影响、我们已采取或将要采取的处置措施、您可自主防范和降低风险的建议、对您的补救措施等。我们将及时将事件相关情况以</span></span><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #333333, font-size: 10.0000pt, mso-font-kerning: 0.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">手机短信的</span></span><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #333333, font-size: 10.0000pt, mso-font-kerning: 0.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">方式告知您，难以逐一告知个人信息主体时，我们会采取合理、有效的方式发布公告。</span></span></p>\\n<p class=\\\"p\\\" style=\\\"margin-top: 0.0000pt, margin-bottom: 7.5000pt, background: #ffffff,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #333333, font-size: 10.0000pt, mso-font-kerning: 0.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">五、我们如何处理未成年人的个人信息</span></span></p>\\n<p class=\\\"p\\\" style=\\\"margin-top: 0.0000pt, margin-bottom: 7.5000pt, margin-left: 22.7000pt, mso-para-margin-left: 0.0000gd, text-indent: 0.0000pt, mso-char-indent-count: 0.0000, background: #ffffff, mso-list: l0 level1 lfo4,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑, color: #333333, font-size: 10.0000pt, mso-font-kerning: 0.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"mso-list: Ignore,\\\" data-mce-fragment=\\\"1\\\">1.&nbsp,</span></span><!--[endif]--><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #333333, font-size: 10.0000pt, mso-font-kerning: 0.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">我们的服务主要面向成年人（原则上</span><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">18周岁以上为成年人，16周岁以上且以自己的劳动收入为主要生活来源的我们亦视为成年人）。若您是未成年人，在使用我们的产品和/或服务前，您应在监护人的陪同下阅读本隐私政策，并应确保已征得您的监护人同意后使用我们的服务并向我们提供您的信息。 我们会根据国家相关法律法规的规定着重保护未成年人的个人信息。</span></span></p>\\n<p class=\\\"p\\\" style=\\\"margin-top: 0.0000pt, margin-bottom: 7.5000pt, margin-left: 22.7000pt, mso-para-margin-left: 0.0000gd, text-indent: 0.0000pt, mso-char-indent-count: 0.0000, background: #ffffff, mso-list: l0 level1 lfo4,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑, color: #333333, font-size: 10.0000pt, mso-font-kerning: 0.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"mso-list: Ignore,\\\" data-mce-fragment=\\\"1\\\">2.&nbsp,</span></span><!--[endif]--><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #333333, font-size: 10.0000pt, mso-font-kerning: 0.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">如您的监护人不同意您按照本隐私政策使用我们的服务或向我们提供信息，请您立即终止使用我们的服务并及时通知我们。</span></span></p>\\n<p class=\\\"p\\\" style=\\\"margin-top: 0.0000pt, margin-bottom: 7.5000pt, margin-left: 22.7000pt, mso-para-margin-left: 0.0000gd, text-indent: 0.0000pt, mso-char-indent-count: 0.0000, background: #ffffff, mso-list: l0 level1 lfo4,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑, color: #333333, font-size: 10.0000pt, mso-font-kerning: 0.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"mso-list: Ignore,\\\" data-mce-fragment=\\\"1\\\">3.&nbsp,</span></span><!--[endif]--><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #333333, font-size: 10.0000pt, mso-font-kerning: 0.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">若您是未成年人的监护人，当您对您所监护的未成年人使用我们的服务或其向我们提供的用户信息有任何疑问时，请您及时与我们联系。我们将根据国家相关法律法规及本隐私政策的规定保护未成年人用户信息的保密性及安全性。如果我们发现自己在未事先获得可证实的父母或法定监护人同意的情况下收集了未成年人的个人信息，则会设法尽快删除相关数据。</span></span></p>\\n<p class=\\\"p\\\" style=\\\"margin-top: 0.0000pt, margin-bottom: 7.5000pt, background: #ffffff,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #333333, font-size: 10.0000pt, mso-font-kerning: 0.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">六、本隐私政策的更新和通知</span></span></p>\\n<p class=\\\"p\\\" style=\\\"margin-top: 0.0000pt, margin-bottom: 7.5000pt, text-indent: 24.0000pt, background: #ffffff,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #333333, font-size: 10.0000pt, mso-font-kerning: 0.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">我们的隐私政策可能变更</span></span><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #333333, font-size: 10.0000pt, mso-font-kerning: 0.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">，</span></span><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #333333, font-size: 10.0000pt, mso-font-kerning: 0.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">未经您明确同意，我们不会削减您按照本隐私政策所应享有的权利</span></span><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #333333, font-size: 10.0000pt, mso-f