argin-left: 0.0000gd, text-indent: 0.0000pt, mso-char-indent-count: 0.0000, background: #ffffff, mso-list: l3 level1 lfo5, margin: 0.0000pt 10.5000pt 7.5000pt 22.7000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑, color: #333333, font-size: 10.0000pt, mso-font-kerning: 0.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"mso-list: Ignore,\\\" data-mce-fragment=\\\"1\\\">5.&nbsp,</span></span><!--[endif]--><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #333333, font-size: 10.0000pt, mso-font-kerning: 0.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">我们负责处理个人信息安全的责任部门、联络方式及投诉渠道发生变化时。</span></span></p>\\n<p class=\\\"MsoNormal\\\" style=\\\"mso-para-margin-left: 0.0000gd, text-autospace: ideograph-numeric, mso-pagination: none, text-align: left,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"mso-spacerun: \'yes\', font-family: 宋体, mso-ascii-font-family: Calibri, mso-hansi-font-family: Calibri, mso-bidi-font-family: \'Times New Roman\', font-size: 14.0000pt, mso-font-kerning: 1.0000pt,\\\" data-mce-fragment=\\\"1\\\">&nbsp,</span></p>\"}','隐私策略中文配置'),
        (87,'SERVICE_POLICY_CONFIG_3','{\"content\":\"<p class=\\\"MsoNormal\\\" style=\\\"mso-para-margin-top: 0.0000gd, mso-para-margin-bottom: 0.0000gd, page-break-before: always, text-align: left,\\\" data-mce-fragment=\\\"1\\\"><strong style=\\\"mso-bidi-font-weight: normal,\\\" data-mce-fragment=\\\"1\\\"><span class=\\\"15\\\" style=\\\"mso-spacerun: \'yes\', font-family: 宋体, mso-ansi-font-weight: bold, font-size: 26.0000pt, mso-font-kerning: 22.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: Times New Roman,\\\" data-mce-fragment=\\\"1\\\">Privacy Policy</span></span></strong><strong style=\\\"mso-bidi-font-weight: normal,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #323232, mso-ansi-font-weight: bold, font-size: 20.0000pt, mso-font-kerning: 1.0000pt,\\\" data-mce-fragment=\\\"1\\\">&nbsp,</span></strong></p>\\n<p class=\\\"MsoNormal\\\" style=\\\"mso-para-margin-top: 0.0000gd, mso-para-margin-bottom: 0.0000gd, text-align: left,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #323232, font-size: 9.5000pt, mso-font-kerning: 1.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">This site (hereinafter also referred to as \\\"we\\\") is well aware of the importance of personal information to you, we respect and protect the personal information of all users who use our platform services, and will do our best to protect your personal information safe and reliable. We are committed to maintaining your trust in us and abide by the following principles to protect your personal information: the principle of consistency of rights and responsibilities, the principle of clear purpose, the principle of consent, the principle of minimum sufficient, the principle of ensuring security, the principle of subject participation, the principle of openness and transparency. At the same time, we promise that we will take appropriate security measures to protect your personal information according to the industry\'s mature security standards. Please read and understand this Privacy Policy (hereinafter referred to as the \\\"Privacy Policy\\\") carefully before using our products (or services). </span></span></p>\\n<h2 data-mce-fragment=\\\"1\\\"><strong style=\\\"mso-bidi-font-weight: normal,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"mso-spacerun: \'yes\', font-family: 黑体, mso-ascii-font-family: Arial, mso-hansi-font-family: Arial, mso-bidi-font-family: \'Times New Roman\', mso-ansi-font-weight: bold, font-size: 16.0000pt, mso-font-kerning: 1.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: Arial,\\\" data-mce-fragment=\\\"1\\\">The legal basis on which we process personal information </span></span></strong></h2>\\n<p class=\\\"MsoNormal\\\" style=\\\"mso-para-margin-top: 0.0000gd, mso-para-margin-bottom: 0.0000gd, text-align: left,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #323232, font-size: 9.5000pt, mso-font-kerning: 1.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">The legal basis for the formulation of this privacy policy is the Law of the People\'s Republic of China on the Protection of Consumer Rights and Interests, the Cybersecurity Law of the People\'s Republic of China, the E-commerce Law of the People\'s Republic of China, the Code for the Security of Personal Information in Information Security Technology and other relevant laws and regulations involving </span></span></p>\\n<p class=\\\"MsoNormal\\\" style=\\\"mso-para-margin-top: 0.0000gd, mso-para-margin-bottom: 0.0000gd, page-break-before: always, text-align: left,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #323232, font-size: 9.5000pt, mso-font-kerning: 1.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">citizens\' personal information. In general, we collect your personal information based on the functions indicated in this Privacy Policy. In some cases, if the collection involves other information, we will show you the terms of the Personal Information Protection Statement separately. </span></span></p>\\n<h2 data-mce-fragment=\\\"1\\\"><strong style=\\\"mso-bidi-font-weight: normal,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"mso-spacerun: \'yes\', font-family: 黑体, mso-ascii-font-family: Arial, mso-hansi-font-family: Arial, mso-bidi-font-family: \'Times New Roman\', mso-ansi-font-weight: bold, font-size: 16.0000pt, mso-font-kerning: 1.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: Arial,\\\" data-mce-fragment=\\\"1\\\">The scope of application of this Privacy Policy </span></span></strong></h2>\\n<p class=\\\"MsoNormal\\\" style=\\\"mso-para-margin-top: 0.0000gd, mso-para-margin-bottom: 0.0000gd, text-align: left,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #323232, font-size: 9.5000pt, mso-font-kerning: 1.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">This Privacy Policy applies to your use of the products or services of this platform. </span></span></p>\\n<h2 data-mce-fragment=\\\"1\\\"><strong style=\\\"mso-bidi-font-weight: normal,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"mso-spacerun: \'yes\', font-family: 黑体, mso-ascii-font-family: Arial, mso-hansi-font-family: Arial, mso-bidi-font-family: \'Times New Roman\', mso-ansi-font-weight: bold, font-size: 16.0000pt, mso-font-kerning: 1.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: Arial,\\\" data-mce-fragment=\\\"1\\\">How do we collect and use your Personal information </span></span></strong></h2>\\n<p class=\\\"MsoNormal\\\" style=\\\"mso-para-margin-top: 0.0000gd, mso-para-margin-bottom: 0.0000gd, text-align: left,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #323232, font-size: 9.5000pt, mso-font-kerning: 1.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">Personal information refers to all kinds of information recorded by electronic or other means that can identify a specific natural person or reflect the activities of a specific natural person alone or in combination with other information. </span></span></p>\\n<p class=\\\"MsoNormal\\\" style=\\\"mso-para-margin-top: 0.0000gd, mso-para-margin-bottom: 0.0000gd, text-align: left,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #323232, font-size: 9.5000pt, mso-font-kerning: 1.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">Sensitive personal information refers to personal information that, if leaked, illegally provided or abused, may endanger personal and property safety, easily lead to damage to personal reputation, physical and mental health, or discriminatory treatment. Before you provide us with any personal information that is sensitive information, please clearly consider that it is appropriate to provide and agree that your personal sensitive information may be processed in accordance with the purposes and methods described in this Privacy Policy. After obtaining your consent, we will collect and use your sensitive personal information to achieve functions related to our business, and allow you to choose not to consent to the collection and use of such sensitive information, but refusing to use such information will affect your use of relevant functions. </span></span></p>\\n<p class=\\\"MsoNormal\\\" style=\\\"mso-para-margin-top: 0.0000gd, mso-para-margin-bottom: 0.0000gd, page-break-before: always, text-align: left,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #323232, font-size: 9.5000pt, mso-font-kerning: 1.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">In principle, we will only collect and use your personal information for the following purposes as described in this Privacy Policy. If we collect and use your personal information for more than the following purposes, we will inform you separately and obtain your consent. </span></span></p>\\n<p class=\\\"MsoNormal\\\" style=\\\"mso-para-margin-top: 0.0000gd, mso-para-margin-bottom: 0.0000gd, text-align: left,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #323232, font-size: 9.5000pt, mso-font-kerning: 1.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">1.</span></span><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #323232, font-size: 9.5000pt, mso-font-kerning: 1.0000pt,\\\" data-mce-fragment=\\\"1\\\">&nbsp,<span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">To help you become our registered/logged in user </span></span></p>\\n<p class=\\\"MsoNormal\\\" style=\\\"mso-para-margin-top: 0.0000gd, mso-para-margin-bottom: 0.0000gd, text-align: left,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #323232, font-size: 9.5000pt, mso-font-kerning: 1.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">You register yourself as our user </span></span></p>\\n<p class=\\\"MsoNormal\\\" style=\\\"mso-para-margin-top: 0.0000gd, mso-para-margin-bottom: 0.0000gd, text-align: left,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #323232, font-size: 9.5000pt, mso-font-kerning: 1.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">When you use the services 