pt and store the user\'s user name and mobile phone number to ensure that the user\'s basic information will not be maliciously obtained, </span></span></p>\\n<p class=\\\"MsoNormal\\\" style=\\\"mso-para-margin-top: 0.0000gd, mso-para-margin-bottom: 0.0000gd, text-align: left,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #323232, font-size: 9.5000pt, mso-font-kerning: 1.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">Identity authentication: we verify the legitimacy of user identity by verifying the account password or the mobile phone number bound to the account to prevent unauthorized intervention, </span></span></p>\\n<p class=\\\"MsoNormal\\\" style=\\\"margin-bottom: 10.6000pt, mso-para-margin-top: 0.0000gd, mso-para-margin-bottom: 0.0000gd, text-align: left,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #323232, font-size: 9.5000pt, mso-font-kerning: 1.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">1. Account protection: Your account has a security protection function, please properly keep your account and password information. Encrypt the user password and other security measures to ensure that your information is not lost, not abused and altered. Despite the aforementioned security measures, please understand that due to technical limitations and possible malicious means, even if we do our best to strengthen security measures, there is no \\\"perfect security measures\\\" on the information network. You shall be responsible for any legal consequences caused by the disclosure of your account and password information due to your own reasons. </span></span></p>\\n<p class=\\\"MsoNormal\\\" style=\\\"mso-para-margin-top: 0.0000gd, mso-para-margin-bottom: 0.0000gd, text-align: left,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #323232, font-size: 9.5000pt, mso-font-kerning: 1.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">2. The Internet environment is not 100% secure and we will do our best to ensure or guarantee the security of any information you send us. In the event of an unfortunate personal information security incident, we will inform you in a timely manner in accordance with the requirements of laws and regulations: the basic situation and possible impact of the security incident, the disposal measures we </span></span></p>\\n<p class=\\\"MsoNormal\\\" style=\\\"mso-para-margin-top: 0.0000gd, mso-para-margin-bottom: 0.0000gd, text-align: left,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #323232, font-size: 9.5000pt, mso-font-kerning: 1.0000pt,\\\" data-mce-fragment=\\\"1\\\">&nbsp,</span></p>\\n<p class=\\\"MsoNormal\\\" style=\\\"mso-para-margin-top: 0.0000gd, mso-para-margin-bottom: 0.0000gd, page-break-before: always, text-align: left,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #323232, font-size: 9.5000pt, mso-font-kerning: 1.0000pt,\\\" data-mce-fragment=\\\"1\\\">&nbsp,</span></p>\\n<p class=\\\"MsoNormal\\\" style=\\\"mso-para-margin-top: 0.0000gd, mso-para-margin-bottom: 0.0000gd, text-align: left,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #323232, font-size: 9.5000pt, mso-font-kerning: 1.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">have taken or will take, the suggestions you can independently prevent and reduce risks, and the remedial measures for you. We will promptly inform you of the incident by mobile phone SMS. When it is difficult to inform the subject of personal information one by one, we will take a reasonable and effective way to issue an announcement. </span></span></p>\\n<p class=\\\"MsoNormal\\\" style=\\\"mso-para-margin-top: 0.0000gd, mso-para-margin-bottom: 0.0000gd, text-align: left,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #000000, font-size: 9.5000pt, mso-font-kerning: 1.0000pt,\\\" data-mce-fragment=\\\"1\\\">&nbsp,</span></p>\\n<h2 data-mce-fragment=\\\"1\\\"><strong style=\\\"mso-bidi-font-weight: normal,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"mso-spacerun: \'yes\', font-family: 黑体, mso-ascii-font-family: Arial, mso-hansi-font-family: Arial, mso-bidi-font-family: \'Times New Roman\', mso-ansi-font-weight: bold, font-size: 16.0000pt, mso-font-kerning: 1.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: Arial,\\\" data-mce-fragment=\\\"1\\\">How do we handle minors\' personal information </span></span></strong></h2>\\n<p class=\\\"MsoNormal\\\" style=\\\"margin-bottom: 10.6000pt, mso-para-margin-top: 0.0000gd, mso-para-margin-bottom: 0.0000gd, text-align: left,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #323232, font-size: 9.5000pt, mso-font-kerning: 1.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">1. Our services are mainly aimed at adults (in principle, adults over the age of 18, and we also consider adults over the age of 16 who rely on their own labor income as their main source of living). If you are a minor, you should read this Privacy Policy with a guardian before using our products and/or services, and you should ensure that you have obtained the consent of your guardian to use our services and provide us with your information. We will focus on protecting minors\' personal information in accordance with relevant national laws and regulations. </span></span></p>\\n<p class=\\\"MsoNormal\\\" style=\\\"margin-bottom: 10.6000pt, mso-para-margin-top: 0.0000gd, mso-para-margin-bottom: 0.0000gd, text-align: left,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #323232, font-size: 9.5000pt, mso-font-kerning: 1.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">2. If your guardian does not agree with your use of our services or the provision of information to us in accordance with this Privacy Policy, please terminate your use of our Services immediately and notify us in time. </span></span></p>\\n<p class=\\\"MsoNormal\\\" style=\\\"mso-para-margin-top: 0.0000gd, mso-para-margin-bottom: 0.0000gd, text-align: left,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #323232, font-size: 9.5000pt, mso-font-kerning: 1.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">3. If you are the guardian of a minor, if you have any questions about the minor under your custody\'s use of our Services or the user information that he or she provides to us, please contact us in time. We will protect the confidentiality and security of minor user information in accordance with relevant national laws and regulations and this privacy policy. If we discover that we have collected personal information from minors without prior verifiable parental or legal guardian consent, we will try to delete the data as soon as possible. </span></span></p>\\n<p class=\\\"MsoNormal\\\" style=\\\"mso-para-margin-top: 0.0000gd, mso-para-margin-bottom: 0.0000gd, text-align: left,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #000000, font-size: 9.5000pt, mso-font-kerning: 1.0000pt,\\\" data-mce-fragment=\\\"1\\\">&nbsp,</span></p>\\n<h2 data-mce-fragment=\\\"1\\\"><strong style=\\\"mso-bidi-font-weight: normal,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"mso-spacerun: \'yes\', font-family: 黑体, mso-ascii-font-family: Arial, mso-hansi-font-family: Ari