        (88,'SERVICE_TERMS_CONFIG_1','{\"content\":\"<p class=\\\"MsoNormal\\\" style=\\\"mso-para-margin-right: 0.0000gd, mso-para-margin-left: 0.0000gd, mso-pagination: widow-orphan, text-align: center, mso-outline-level: 2, background: #ffffff, margin: 15.0000pt 10.5000pt 7.5000pt 10.5000pt,\\\" align=\\\"center\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #333333, font-size: 24.0000pt, mso-font-kerning: 0.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">服务条款</span></span><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #333333, font-size: 24.0000pt, mso-font-kerning: 0.0000pt,\\\" data-mce-fragment=\\\"1\\\"><br data-mce-fragment=\\\"1\\\" /></span><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #333333, font-size: 24.0000pt, mso-font-kerning: 0.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">&nbsp,&nbsp,</span></span></p>\\n<p class=\\\"MsoNormal\\\" style=\\\"margin-right: 0.0000pt, margin-bottom: 7.5000pt, mso-para-margin-right: 0.0000gd, mso-pagination: widow-orphan, text-align: left, background: #ffffff,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #333333, font-size: 10.0000pt, mso-font-kerning: 0.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">一、定义</span></span></p>\\n<p class=\\\"MsoNormal\\\" style=\\\"margin-right: 0.0000pt, margin-bottom: 7.5000pt, margin-left: 0.0000pt, mso-para-margin-right: 0.0000gd, mso-para-margin-left: 0.0000gd, text-indent: 24.0000pt, mso-pagination: widow-orphan, text-align: left, background: #ffffff,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #333333, font-size: 10.0000pt, mso-font-kerning: 0.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">平台，是指您当前所浏览的网站平台。</span></span></p>\\n<p class=\\\"MsoNormal\\\" style=\\\"margin-right: 0.0000pt, margin-bottom: 7.5000pt, margin-left: 0.0000pt, mso-para-margin-right: 0.0000gd, mso-para-margin-left: 0.0000gd, text-indent: 24.0000pt, mso-pagination: widow-orphan, text-align: left, background: #ffffff,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #333333, font-size: 10.0000pt, mso-font-kerning: 0.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">用户，包含注册用户和非注册用户，以下亦称为</span><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">&ldquo,您&rdquo,。注册用户是指通过我们平台完成全部注册程序后，使用我们平台服务或我们网站资料的用户。非注册用户是指未进行注册、直接登录我们平台或通过其他网站进入我们平台直接或间接地使用我们平台服务或我们网站资料的用户。</span></span></p>\\n<p class=\\\"MsoNormal\\\" style=\\\"margin-right: 0.0000pt, margin-bottom: 7.5000pt, margin-left: 0.0000pt, mso-para-margin-right: 0.0000gd, mso-para-margin-left: 0.0000gd, text-indent: 24.0000pt, mso-pagination: widow-orphan, text-align: left, background: #ffffff,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #333333, font-size: 10.0000pt, mso-font-kerning: 0.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">协议方，本协议中协议双方合称</span><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">&ldquo,协议方&rdquo,。</span></span></p>\\n<p class=\\\"MsoNormal\\\" style=\\\"margin-right: 0.0000pt, margin-bottom: 7.5000pt, mso-para-margin-right: 0.0000gd, mso-pagination: widow-orphan, text-align: left, background: #ffffff,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #333333, font-size: 10.0000pt, mso-font-kerning: 0.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">二、协议的效力</span></span></p>\\n<p class=\\\"MsoNormal\\\" style=\\\"margin-right: 0.00