: \'yes\', font-family: 微软雅黑, color: #333333, font-size: 10.0000pt, mso-font-kerning: 0.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">提供的服务（以下称为</span><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">&ldquo,我们平台服务&rdquo,）均受本协议约束。您承诺接受并遵守本协议的约定。如果您不同意本协议的约定，您应立即停止注册程序或停止使用我们平台服务；如您继续访问和使用我们平台服务，即视为您已确知并完全同意本协议各项内容。</span></span></p>\\n<p class=\\\"MsoNormal\\\" style=\\\"margin-right: 0.0000pt, margin-bottom: 7.5000pt, margin-left: 42.2500pt, mso-para-margin-right: 0.0000gd, mso-para-margin-left: 0.0000gd, text-indent: -21.2500pt, mso-char-indent-count: 0.0000, mso-pagination: widow-orphan, text-align: left, background: #ffffff, mso-list: l1 level1 lfo1,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑, color: #333333, font-size: 10.0000pt, mso-font-kerning: 0.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"mso-list: Ignore,\\\" data-mce-fragment=\\\"1\\\">3.&nbsp,</span></span><!--[endif]--><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #333333, font-size: 10.0000pt, mso-font-kerning: 0.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">我们有权根据国家法律法规的更新、产品和服务规则的调整需要不时地制订、修改本协议或各类规则，并提前以网站公示的方式进行公示。如您继续使用我们平台服务的，即表示您接受经修订的协议和规则。如发生有关争议时，以我们最新的相关协议和规则为准。</span></span></p>\\n<p class=\\\"MsoNormal\\\" style=\\\"margin-right: 0.0000pt, margin-bottom: 7.5000pt, mso-para-margin-right: 0.0000gd, mso-pagination: widow-orphan, text-align: left, background: #ffffff,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #333333, font-size: 10.0000pt, mso-font-kerning: 0.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">三、注册</span></span></p>\\n<p class=\\\"MsoNormal\\\" style=\\\"margin-right: 0.0000pt, margin-bottom: 7.5000pt, margin-left: 42.2500pt, mso-para-margin-right: 0.0000gd, mso-para-margin-left: 0.0000gd, text-indent: -21.2500pt, mso-char-indent-count: 0.0000, mso-pagination: widow-orphan, text-align: left, background: #ffffff, mso-list: l3 level1 lfo2,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑, color: #333333, font-size: 10.0000pt, mso-font-kerning: 0.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"mso-list: Ignore,\\\" data-mce-fragment=\\\"1\\\">1.&nbsp,</span></span><!--[endif]--><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #333333, font-size: 10.0000pt, mso-font-kerning: 0.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">在您完成注册程序使用我们平台服务</span></span><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #333333, font-size: 10.0000pt, mso-font-kerning: 0.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">后</span></span><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #333333, font-size: 10.0000pt, mso-font-kerning: 0.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">，您应当是具备相应民事行为能力的自然人（十六周岁以上的未成年人，以自己的劳动收入为主要生活来源的，视为完全民事行为能力人）、法人或其他组织。若您不具备前述主体资格，则您及您的家长或法定监护人（以下统称</span><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">\\\"监护人\\\"）应承担因此而导致的一切后果，且我们有权注销您的账户，并向您及您的监护人索偿。</span></span></p>\\n<p class=\\\"MsoNormal\\\" style=\\\"margin-right: 0.0000pt, margin-bottom: 7.5000pt, margin-left: 42.2500pt, mso-para-margin-right: 0.0000gd, mso-para-margin-left: 0.0000gd, text-indent: -21.2500pt, mso-char-indent-count: 0.0000, mso-pagination: widow-orphan, text-align: left, background: #ffffff, mso-list: l3 level1 lfo2,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑, color: #333333, font-size: 10.0000pt, mso-font-kerning: 0.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"mso-list: Ignore,\\\" data-mce-fragment=\\\"1\\\">2.&nbsp,</span></span><!--[endif]--><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #333333, font-size: 10.0000pt, mso-font-kerning: 0.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">我们非常重视对青少年个人信息搜集和使用的安全性的保护。我们建议，任何未满</span><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">18周岁的未成年人参加网上活动应事先取得其监护人可经查证的同意并遵守《全国青少年网络文明公约》。监护人应承担未成年人网络活动风险及保护未成年人相关网络隐私的首要责任。</span></span></p>\\n<p class=\\\"MsoNormal\\\" style=\\\"margin-right: 0.0000pt, margin-bottom: 7.5000pt, margin-left: 42.2500pt, mso-para-margin-right: 0.0000gd, mso-para-margin-left: 0.0000gd, text-indent: -21.2500pt, mso-char-indent-count: 0.0000, mso-pagination: widow-orphan, text-align: left, background: #ffffff, mso-list: l3 level1 lfo2,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑, color: #333333, font-size: 10.0000pt, mso-font-kerning: 0.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"mso-list: Ignore,\\\" data-mce-fragment=\\\"1\\\">3.&nbsp,</span></span><!--[endif]--><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #333333, font-size: 10.0000pt, mso-font-kerning: 0.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">在您签署本协议，完成注册程序</span></span><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #333333, font-size: 10.0000pt, mso-font-kerning: 0.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">后，</span></span><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #333333, font-size: 10.0000pt, mso-font-kerning: 0.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">您应对您的用户名、登录密码的安全，以及对通过您的账户和密码实施的行为负责</span></span><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #333333, font-size: 10.0000pt, mso-font-kerning: 0.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">，</span></span><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #333333, font-size: 10.0000pt, mso-font-kerning: 0.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">因此所衍生的任何损失或损害，我们无法也不承担任何责任。除非有法律规定或行政司法机关的指令，且征得我们的同意，否则您的用户名、登录密码不得以任何方式转让、借用、赠与、继承（与账户相关的财产权益除外）</span><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">&lt,或&gt,在第三方平台上进行展示或售卖。否则，由此给您（或我们、任何第三方）造成的一切损失，概由您自行承担（或者负责赔偿）。</span></span></p>\\n<p class=\\\"MsoNormal\\\" style=\\\"margin-right: 0.0000pt, margin-bottom: 7.5000pt, margin-left: 42.2500pt, mso-para-margin-right: 0.0000gd, mso-para-margin-left: 0.0000gd, text-indent: -21.2500pt, mso-char-indent-count: 0.0000, mso-pagination: widow-orphan, text-align: left, background: #ffffff, mso-list: l3 level1 lfo2,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑, color: #333333, font-size: 10.0000pt, mso-font-kerning: 0.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"mso-list: Ignore,\\\" data-mce-fragment=\\\"1\\\">4.&nbsp,</span></span><!--[endif]--><span style=\\\"mso-spacerun: \'yes\', font-family: 微软雅黑, color: #333333, font-size: 10.0000pt, mso-font-kerning: 0.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑,\\\" data-mce-fragment=\\\"1\\\">您在注册帐号或使用我们平台服务的过程中，应提供合法、真实、准确的个人资料，您填写的个人资料有变动的，应及时进行更新。如果因您提供的个人资料不合法、不真实、不准确的，您需承担因此引起的相应责任及后果，并且我们保留终止您使用我们各项服务的权利。</span></span></p>\\n<p class=\\\"MsoNormal\\\" style=\\\"margin-right: 0.0000pt, margin-bottom: 7.5000pt, margin-left: 42.2500pt, mso-para-margin-right: 0.0000gd, mso-para-margin-left: 0.0000gd, text-indent: -21.2500pt, mso-char-indent-count: 0.0000, mso-pagination: widow-orphan, text-align: left, background: #ffffff, mso-list: l3 level1 lfo2,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"font-family: 微软雅黑, color: #333333, font-size: 10.0000pt, mso-font-kerning: 0.0000pt,\\\" data-mce-fragment=\\\"1\\\"><span style=\\\"mso-list: Ignore,\\\" data-mce-fragment=\\