/*Table structure for table `tz_app_connect` */

DROP TABLE IF EXISTS `tz_app_connect`;

CREATE TABLE `tz_app_connect`
(
    `id`               bigint(20) unsigned                     NOT NULL AUTO_INCREMENT COMMENT 'id',
    `user_id`          varchar(36)  DEFAULT NULL COMMENT '本系统userId',
    `app_id`           varchar(36)  DEFAULT NULL COMMENT '第三方系统appId, 1：小程序 2：公众号',
    `nick_name`        varchar(255) DEFAULT NULL COMMENT '第三方系统昵称',
    `image_url`        varchar(500) DEFAULT NULL COMMENT '第三方系统头像',
    `biz_user_id`      varchar(255) DEFAULT NULL COMMENT '第三方系统userid',
    `biz_unionid`      varchar(255) DEFAULT NULL COMMENT '第三方系统unionid',
    `temp_uid`         varchar(36) COLLATE utf8mb4_general_ci  NULL COMMENT '当社交账号未绑定时，临时的uid',
    `biz_temp_session` varchar(255) COLLATE utf8mb4_general_ci NULL COMMENT '有些时候第三方系统授权之后，会有个临时的key，比如小程序的session_key',
    PRIMARY KEY (`id`),
    UNIQUE KEY `uni_bizuserid` (`app_id`, `biz_user_id`),
    KEY `user_app_id` (`user_id`, `app_id`) COMMENT '用户id和appid联合索引'
) ENGINE = InnoDB
  DEFAULT CHARSET = utf8mb4
  COLLATE = 'utf8mb4_general_ci' COMMENT ='用户第三方登录信息';

/*Data for the table `tz_app_connect` */

/*Table structure for table `tz_area` */

DROP TABLE IF EXISTS `tz_area`;

CREATE TABLE `tz_area`
(
    `area_id`          bigint NOT NULL AUTO_INCREMENT,
    `area_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '地区中文名称',
    `area_name_en` varchar(255) NULL COMMENT '地区英文名称',
    `area_name_pinyin` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '地区拼音名称',
    `parent_id`        bigint                                                       DEFAULT NULL,
    `level`            int                                                          DEFAULT NULL,
    PRIMARY KEY (`area_id`) USING BTREE,
    KEY `parent_id` (`parent_id`) USING BTREE COMMENT '上级id'
) ENGINE = InnoDB
  AUTO_INCREMENT = 682123
  DEFAULT CHARSET = utf8mb4
  COLLATE = utf8mb4_general_ci
  ROW_FORMAT = DYNAMIC COMMENT ='省市区地区信息';
/*Data for the table `tz_area` */

/*Table structure for table `tz_hot_city` */

DROP TABLE IF EXISTS `tz_hot_city`;

CREATE TABLE `tz_hot_city`
(
    `hot_city_id` bigint unsigned NOT NULL AUTO_INCREMENT COMMENT '主键Id',
    `area_id`     bigint          NOT NULL COMMENT '城市Id',
    `area_name`   varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '城市名称',
    `area_name_en` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '地区英文名称',
    `seq`         int                                                          DEFAULT NULL COMMENT '顺序',
    `status`      tinyint                                                      DEFAULT NULL COMMENT '状态 0下线 1上线',
    `create_time` datetime        NOT NULL                                     DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
    `update_time` datetime        NOT NULL                                     DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
    PRIMARY KEY (`hot_city_id`) USING BTREE,
    KEY `area_idx`(`area_id`)
) ENGINE = InnoDB
  DEFAULT CHARSET = utf8mb4
  COLLATE = utf8mb4_general_ci COMMENT ='热门城市';

/*Data for the table `tz_hot_city` */

/*Table structure for table `tz_attach_file` */

DROP TABLE IF EXISTS `tz_attach_file`;

CREATE TABLE `tz_attach_file`
(
    `file_id`              bigint(20) NOT NULL AUTO_INCREMENT,
    `file_path`            varchar(255) DEFAULT NULL COMMENT '文件路径',
    `file_type`            varchar(20)  DEFAULT NULL COMMENT '文件类型',
    `file_name`            varchar(255) DEFAULT NULL COMMENT '文件名',
    `file_size`            int(11)      DEFAULT NULL COMMENT '文件大小',
    `upload_time`          datetime     DEFAULT NULL COMMENT '上传时间',
    `shop_id`              bigint(20)   DEFAULT NULL COMMENT '店铺id',
    `type`                 tinyint(4)   DEFAULT NULL COMMENT '文件 1:图片 2:视频 3:文件',
    `attach_file_group_id` bigint       DEFAULT '0' COMMENT '文件分组id',
    `is_upload`            tinyint      DEFAULT 1   COMMENT '是否已上传(0:否, 1:是)',
    PRIMARY KEY (`file_id`),
    KEY `group_id_index`(`attach_file_group_id`),
    KEY `shop_id_index`(`shop_id`)
) ENGINE = InnoDB
  DEFAULT CHARSET = utf8mb4
  COLLATE = 'utf8mb4_general_ci' COMMENT ='上传文件记录表';

/*Data for the table `tz_attach_file` */

DROP TABLE IF EXISTS `tz_attach_file_group`;

CREATE TABLE `tz_attach_file_group`
(
    `attach_file_group_id` bigint                                                      NOT NULL AUTO_INCREMENT,
    `shop_id`              bigint                                                      NOT NULL COMMENT '店铺id',
    `name`                 varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '分组名称',
    `type`                 tinyint                                                     NOT NULL COMMENT '1:图片 2:视频 3:文件',
    PRIMARY KEY (`attach_file_group_id`),
    KEY `shop_id_index`(`shop_id`)
) ENGINE = InnoDB
  DEFAULT CHARSET = utf8mb4
  COLLATE = utf8mb4_general_ci COMMENT ='文件分组表';

/*Table structure for table `tz_basket` */

DROP TABLE IF EXISTS `tz_basket`;

CREATE TABLE `tz_basket`
(
    `basket_id`            bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT '主键',
    `shop_id`              bigint(20)          NOT NULL COMMENT '店铺ID',
    `prod_id`              bigint(20) unsigned NOT NULL DEFAULT '0' COMMENT '产品ID',
    `sku_id`               bigint(20) unsigned NOT NULL DEFAULT '0' COMMENT 'SkuID',
    `user_id`              varchar(50)         NOT NULL COMMENT '用户ID',
    `basket_count`         int(11)             NOT NULL DEFAULT '0' COMMENT '购物车产品个数',
    `basket_date`          datetime            NOT NULL COMMENT '购物时间',
    `discount_id`          bigint(20)                   DEFAULT NULL COMMENT '满减活动ID',
    `distribution_card_no` varchar(36)                  DEFAULT NULL COMMENT '分销推广人卡号',
    `combo_id`             bigint                       DEFAULT '0' COMMENT '套餐id',
    `combo_count`          int                          DEFAULT NULL COMMENT '套餐数量',
    `parent_basket_id`     bigint                       DEFAULT '0' COMMENT '主购物车id（套餐）',
    `is_checked`           tinyint                      DEFAULT NULL COMMENT '是否已经勾选',
    `use_member`           tinyint(0)          NOT NULL DEFAULT 1 COMMENT '是否使用会员优惠 1.使用 0.不使用',
    PRIMARY KEY (`basket_id`),
    UNIQUE KEY `uk_user_shop_sku_combo` (`sku_id`, `user_id`, `shop_id`, `combo_id`, `parent_basket_id`),
    KEY `shop_id` (`shop_id`),
    KEY `user_id` (`user_id`),
    KEY `discount_id`(`discount_id`),
    KEY `combo_id`(`combo_id`)
) ENGINE = InnoDB
  DEFAULT CHARSET = utf8mb4
  COLLATE = 'utf8mb4_general_ci' COMMENT ='购物车';

/*Data for the table `tz_basket` */

/*Table structure for table `tz_brand` */

DROP TABLE IF EXISTS `tz_brand`;

CREATE TABLE `tz_brand`
(
    `brand_id`     BIGINT UNSIGNED                                               NOT NULL AUTO_INCREMENT COMMENT 'brand_id',
    `create_time`  DATETIME                                                      NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
    `update_time`  DATETIME                                                      NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
    `img_url`      VARCHAR(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '品牌logo图片',
    `first_letter` CHAR(1) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci               DEFAULT NULL COMMENT '检索首字母',
    `is_top`       TINYINT                                                                DEFAULT NULL COMMENT '是否置顶',
    `seq`          INT                                                                    DEFAULT NULL COMMENT '排序',
    `status`       TINYINT UNSIGNED                                                       DEFAULT '0' COMMENT '状态 1:enable, 0:disable, -1:deleted',
    `shop_id`      BIGINT                                                                 DEFAULT NULL COMMENT '店铺id,0代表平台品牌',
    PRIMARY KEY (`brand_id`),
    UNIQUE KEY `uni_brand_id` (`brand_id`) USING BTREE
) ENGINE = INNODB
  DEFAULT CHARSET = utf8mb4
  COLLATE = utf8mb4_general_ci COMMENT ='品牌信息';

DROP TABLE IF EXISTS `tz_brand_lang`;

CREATE TABLE `tz_brand_lang`
(
    `brand_id` bigint  NOT NULL COMMENT '品牌id',
    `lang`     tinyint NOT NULL COMMENT '语言 0.通用 1.中文 2.英文',
    `name`     varchar(250) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '品牌名称',
    PRIMARY KEY (`brand_id`, `lang`)
) ENGINE = InnoDB
  DEFAULT CHARSET = utf8mb4
  COLLATE = utf8mb4_general_ci COMMENT ='品牌-国际化表';

/*Data for the table `tz_brand` */

/*Table structure for table `tz_category` */

DROP TABLE IF EXISTS `tz_category`;

CREATE TABLE `tz_category`
(
    `category_id`    bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT '类目ID',
    `shop_id`        bigint(20)          NOT NULL COMMENT '店铺ID',
    `parent_id`      bigint(20) unsigned NOT NULL COMMENT '父节点',
    `icon`           varchar(255)                 DEFAULT NULL COMMENT '类目图标',
    `pic`            varchar(300)                 DEFAULT NULL COMMENT '类目的显示图片',
    `seq`            int(11)             NOT NULL COMMENT '排序',
    `status`         int(11)             NOT NULL DEFAULT '1' COMMENT '默认是1，表示正常状态,0为下线状态',
    `rec_time`       datetime            NOT NULL COMMENT '记录时间',
    `grade`          int(11)             NOT NULL COMMENT '分类层级',
    `deduction_rate` decimal(10, 4)      NULL     DEFAULT NULL COMMENT '分类扣率（1代表1%）',
    `update_time`    datetime                     DEFAULT NULL COMMENT '更新时间',
    PRIMARY KEY (`category_id`),
    KEY `parent_id` (`parent_id`),
    KEY `shop_id` (`shop_id`)
) ENGINE = InnoDB
  DEFAULT CHARSET = utf8mb4
  COLLATE = 'utf8mb4_general_ci' COMMENT ='产品类目';

