/*Table structure for table `tz_category_prop` */

DROP TABLE IF EXISTS `tz_category_prop`;

CREATE TABLE `tz_category_prop`
(
    `id`          bigint(20) NOT NULL AUTO_INCREMENT,
    `category_id` bigint(20) DEFAULT NULL COMMENT '分类id',
    `prop_id`     bigint(20) DEFAULT NULL COMMENT '商品属性id即表tz_prod_prop中的prop_id',
    PRIMARY KEY (`id`),
    KEY `category_id` (`category_id`),
    KEY `prop_id` (`prop_id`)
) ENGINE = InnoDB
  DEFAULT CHARSET = utf8mb4
  COLLATE = 'utf8mb4_general_ci' COMMENT ='分类规格关联信息';

/*Data for the table `tz_category_prop` */

/*Table structure for table `tz_delivery` */

DROP TABLE IF EXISTS `tz_delivery`;

CREATE TABLE `tz_delivery` (
                               `dvy_id` bigint unsigned NOT NULL AUTO_INCREMENT COMMENT 'ID',
                               `dvy_name` varchar(50) COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '物流公司名称',
                               `name_en` varchar(50) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '物流公司英文名称',
                               `name_hk` varchar(50) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '物流公司名称(香港)',
                               `country` varchar(50) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '国家/地区',
                               `country_iso` varchar(50) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '国家',
                               `company_home_url` varchar(255) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '公司主页',
                               `rec_time` datetime NOT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '建立时间',
                               `modify_time` datetime NOT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '修改时间',
                               `query_url` varchar(520) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '物流查询接口',
                               `dvy_no_track` varchar(40) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '物流公司编号(Tracking17)',
                               `dvy_no_hd` varchar(40) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '物流公司编号(快递100)',
                               `status` tinyint NOT NULL DEFAULT '1' COMMENT '状态 1：正常 -1：删除',
                               `dvy_no17` varchar(40) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '物流公司编号（tracking17）',
                               PRIMARY KEY (`dvy_id`) USING BTREE,
                               KEY `11` (`dvy_name`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=4838 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci COMMENT='物流公司';



/*Table structure for table `tz_delivery_order` */

DROP TABLE IF EXISTS `tz_delivery_order`;

CREATE TABLE `tz_delivery_order`
(
    `order_delivery_id` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT '订单物流包裹id',
    `order_number`      varchar(50)         NOT NULL COMMENT '订单号',
    `dvy_id`            bigint(20)   DEFAULT NULL COMMENT '快递公司编号',
    `dvy_flow_id`       varchar(100) DEFAULT NULL COMMENT '快递单号',
    `receiver_mobile`   varchar(255) DEFAULT NULL COMMENT '收件人手机号',
    `status`            int(11)      DEFAULT '1' COMMENT '物流状态 1正常 -1删除',
    `product_nums`      int(11)      DEFAULT NULL COMMENT '包裹商品总数',
    `create_time`       datetime     DEFAULT NULL COMMENT '创建时间',
    `update_time`       datetime     DEFAULT NULL COMMENT '更新时间',
    `delivery_type`     int          DEFAULT NULL COMMENT '发货方式(1.快递 3.无需物流 4.同城配送)',
    `delete_time`       datetime     DEFAULT NULL COMMENT '删除时间',
    PRIMARY KEY (`order_delivery_id`),
    KEY `dvy_order_idx`(`order_number`, `dvy_id`),
    KEY `dvy_id`(`dvy_id`)
) ENGINE = InnoDB
  DEFAULT CHARSET = utf8mb4
  COLLATE = 'utf8mb4_general_ci' COMMENT ='订单物流';

/*Data for the table `tz_delivery_order` */

/*Table structure for table `tz_delivery_order_item` */

DROP TABLE IF EXISTS `tz_delivery_order_item`;

CREATE TABLE `tz_delivery_order_item`
(
    `id`                bigint(20) NOT NULL AUTO_INCREMENT COMMENT '关联id',
    `order_delivery_id` bigint(20) DEFAULT NULL COMMENT '订单物流包裹id',
    `order_item_id`     bigint(20) DEFAULT NULL COMMENT '订单项id',
    `prod_count`        int(11)    DEFAULT '0' COMMENT '商品数量',
    PRIMARY KEY (`id`),
    KEY `dvy_order_item_idx`(`order_delivery_id`, `order_item_id`)
) ENGINE = InnoDB
  DEFAULT CHARSET = utf8mb4
  COLLATE = 'utf8mb4_general_ci' COMMENT ='订单物流项';

/*Data for the table `tz_delivery_order_item` */

/*Table structure for table `tz_hot_search` */

DROP TABLE IF EXISTS `tz_hot_search`;

CREATE TABLE `tz_hot_search`
(
    `hot_search_id` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT '主键',
    `shop_id`       bigint(20)                   DEFAULT NULL COMMENT '店铺ID 0为全局热搜',
    `content`       varchar(255)        NOT NULL COMMENT '内容',
    `rec_date`      datetime            NOT NULL COMMENT '录入时间',
    `seq`           int(11)                      DEFAULT NULL COMMENT '顺序',
    `status`        tinyint(4)          NOT NULL DEFAULT '1' COMMENT '状态 0下线 1上线',
    `type`          TINYINT(4)          NOT NULL DEFAULT '1' COMMENT '1:商品热搜  2:店铺热搜',
    `title`         varchar(255)        NOT NULL COMMENT '热搜标题',
    PRIMARY KEY (`hot_search_id`) USING BTREE,
    KEY `shop_id` (`shop_id`)
) ENGINE = InnoDB
  DEFAULT CHARSET = utf8mb4
  COLLATE = 'utf8mb4_general_ci' COMMENT ='热搜';

/*Table structure for table `tz_index_img` */

DROP TABLE IF EXISTS `tz_index_img`;

CREATE TABLE `tz_index_img`
(
    `img_id`      bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT '主键',
    `shop_id`     bigint(20)   DEFAULT NULL COMMENT '店铺ID',
    `img_url`     varchar(200)        NOT NULL COMMENT '图片',
    `des`         varchar(200) DEFAULT '' COMMENT '说明文字,描述',
    `title`       varchar(200) DEFAULT NULL COMMENT '标题',
    `link`        varchar(200) DEFAULT NULL COMMENT '链接',
    `status`      tinyint(1)   DEFAULT '0' COMMENT '状态',
    `seq`         int(11)      DEFAULT '0' COMMENT '顺序',
    `upload_time` datetime     DEFAULT NULL COMMENT '上传时间',
    `relation`    bigint(20)   DEFAULT NULL COMMENT '关联',
    `type`        int(11)      DEFAULT NULL COMMENT '类型',
    `img_type`    tinyint(4)   DEFAULT NULL COMMENT '图片类型 0:小程序 1:pc',
    PRIMARY KEY (`img_id`) USING BTREE,
    KEY `shop_id` (`shop_id`) USING BTREE
) ENGINE = InnoDB
  DEFAULT CHARSET = utf8mb4
  COLLATE = 'utf8mb4_general_ci' COMMENT ='主页轮播图';

/*Table structure for table `tz_notice` */

DROP TABLE IF EXISTS `tz_notice`;

CREATE TABLE `tz_notice`
(
    `id`               bigint(20)   NOT NULL AUTO_INCREMENT COMMENT '公告id',
    `shop_id`          bigint(20)  DEFAULT NULL COMMENT '店铺id',
    `title`            varchar(36) DEFAULT NULL COMMENT '公告标题',
    `content`          text COMMENT '公告内容',
    `status`           tinyint(1)  DEFAULT NULL COMMENT '状态(1:公布 0:撤回)',
    `is_top`           tinyint(4)  DEFAULT NULL COMMENT '是否置顶',
    `publish_time`     datetime    DEFAULT NULL COMMENT '发布时间',
    `update_time`      datetime    DEFAULT NULL COMMENT '更新时间',
    `types`            VARCHAR(500) NULL COMMENT '类型(1:商家端显示 2:用户端 3:供应商端显示)',
    `multi_shop_ids`   VARCHAR(500) NULL COMMENT '可见商家范围',
    `visible_user_type` tinyint(1) NOT NULL DEFAULT '0' COMMENT '可见用户类型 0.全部用户可见 1.标签用户可见 2.指定用户可见',
    `user_ids`         VARCHAR(500) NULL COMMENT '指定用户ids',
    `immediately_send` TINYINT     DEFAULT NULL COMMENT '是否立即发送 1：立即发送   0：定时发送',
    `send_time`        DATETIME    DEFAULT NULL COMMENT '定时发送时间',
    PRIMARY KEY (`id`),
    KEY `shop_idx`(`shop_id`)
) ENGINE = InnoDB
  DEFAULT CHARSET = utf8mb4
  COLLATE = 'utf8mb4_general_ci' COMMENT ='公告';

/*Table structure for table `tz_order` */

DROP TABLE IF EXISTS `tz_order`;

CREATE TABLE `tz_order`
(
    `order_id`                     bigint unsigned                                                NOT NULL AUTO_INCREMENT COMMENT '订单ID',
    `shop_id`                      bigint                                                                  DEFAULT NULL COMMENT '店铺id',
    `prod_name`                    varchar(1000) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '产品名称,多个产品将会以逗号隔开',
    `user_id`                      varchar(36) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci   NOT NULL COMMENT '订购用户ID',
    `addr_order_id`                bigint                                                                  DEFAULT NULL COMMENT '用户订单地址Id',
    `order_number`                 varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci   NOT NULL COMMENT '订购流水号',
    `total`                        decimal(15, 2)                                                 NOT NULL DEFAULT '0.00' COMMENT '总值',
    `actual_total`                 decimal(15, 2)                                                          DEFAULT NULL COMMENT '实际总值',
    `pay_type`                     int                                                                     DEFAULT NULL COMMENT '支付方式 请参考枚举PayType',
    `remarks`                      varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci           DEFAULT NULL COMMENT '买家备注',
    `shop_remarks`                 varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci           DEFAULT NULL COMMENT '卖家备注',
    `status`                       int                                                            NOT NULL DEFAULT '0' COMMENT '订单状态 1:待付款 2:待发货 3:待收货 4:待评价 5:成功 6:失败 7:待成团',
    `dvy_type`                     tinyint                                                                 DEFAULT NULL COMMENT '配送类型 1:快递 2:自提 3：无需快递 4同城配送',
    `dvy_id`                       bigint                                                                  DEFAULT NULL COMMENT '配送方式ID',
    `dvy_flow_id`                  varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci           DEFAULT '' COMMENT '物流单号',
    `freight_amount`               decimal(15, 2)                                                          DEFAULT '0.00' COMMENT '订单运费',
    `product_nums`                 int                                                                     DEFAULT NULL COMMENT '订单商品总数',
    `create_time`                  datetime                                                       NOT NULL COMMENT '订购时间',
    `update_time`                  datetime                                                                DEFAULT NULL COMMENT '订单更新时间',
    `pay_time`                     datetime                                                                DEFAULT NULL COMMENT '付款时间',
    `dvy_time`                     datetime                                                                DEFAULT NULL COMMENT '发货时间',
    `finally_time`                 datetime                                                                DEFAULT NULL COMMENT '完成时间',
    `settled_time`                 datetime                                                                DEFAULT NULL COMMENT '结算时间',
    `cancel_time`                  datetime                                                                DEFAULT NULL COMMENT '取消时间',
    `pre_sale_time`                datetime                                                                DEFAULT NULL COMMENT '预售发货时间',
    `is_payed`                     tinyint(1)                                                              DEFAULT NULL COMMENT '是否已经支付，1：已经支付过，0：，没有支付过',
    `delete_status`                int                                                                     DEFAULT '0' COMMENT '用户订单删除状态，0：没有删除， 1：回收站， 2：永久删除',
    `refund_status`                int                                                                     DEFAULT NULL COMMENT '订单退款状态（1:申请退款 2:退款成功 3:部分退款成功 4:退款失败）',
    `reduce_amount`                decimal(15, 2)                                                 NOT NULL DEFAULT '0.00' COMMENT '优惠总额',
    `score_amount`                 decimal(15, 2)                                                 NOT NULL DEFAULT '0.00' COMMENT '积分抵扣金额',
    `member_amount`                decimal(15, 2)                                                 NOT NULL DEFAULT '0.00' COMMENT '会员折扣金额',
    `distribution_amount`          decimal(15, 2)                                                 NOT NULL DEFAULT '0.00' COMMENT '分销佣金金额',
    `shop_coupon_amount`           decimal(15, 2)                                                 NOT NULL DEFAULT '0.00' COMMENT '店铺优惠券优惠金额',
    `discount_amount`              decimal(15, 2)                                                 NOT NULL DEFAULT '0.00' COMMENT '满减优惠金额',
    `shop_combo_amount`            decimal(15, 2)                                                 NOT NULL DEFAULT '0' COMMENT '套餐优惠金额',
    `platform_free_freight_amount` decimal(15, 2)                                                 NOT NULL DEFAULT '0.00' COMMENT '平台免运费金额',
    `free_transfee`                decimal(15, 2)                                                 NOT NULL DEFAULT '0.00' COMMENT '商家免运费金额',
    `shop_change_free_amount`      decimal(15, 2)                                                 NOT NULL DEFAULT '0.00' COMMENT '商家改价金额',
    `is_settled`                   tinyint                                                                 DEFAULT NULL COMMENT '是否已经进行结算 1.已结算，0未结算',
    `order_type`                   tinyint                                                                 DEFAULT NULL COMMENT '订单类型1团购订单 2秒杀订单 3积分订单',
    `close_type`                   tinyint                                                                 DEFAULT NULL COMMENT '订单关闭原因 1-超时未支付 2-退款关闭 4-买家取消 15-已通过货到付款交易',
    `receiver_name`                varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci           DEFAULT NULL COMMENT '收件人姓名',
    `receiver_mobile`              varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci           DEFAULT NULL COMMENT '收件人电话',
    `change_amount_version`        int                                                                     DEFAULT NULL COMMENT '支付金额版本号',
    `order_mold`                   int(11)                                                                 DEFAULT NULL COMMENT '订单类别 0.实物商品订单 1.虚拟商品订单',
    `virtual_remark`               json                                                                    DEFAULT NULL COMMENT '虚拟商城的留言备注',
    `write_off_status`             tinyint(1)                                                              DEFAULT NULL COMMENT '订单核销状态 0.待核销 1.核销完成',
    `write_off_num`                int                                                                     DEFAULT NULL COMMENT '核销次数类型 -1.多次核销 0.无需核销 1.单次核销',
    `write_off_multiple_count`     int                                                                     DEFAULT NULL COMMENT '核销次数 -1.无限次',
    `write_off_start`              datetime                                                                DEFAULT NULL COMMENT '核销开始时间',
    `write_off_end`                datetime                                                                DEFAULT NULL COMMENT '核销结束时间',
    `is_refund`                    tinyint                                                                 DEFAULT NULL COMMENT '是否可以退款 1.可以 0不可以',
    main_order_number               BIGINT                                                        NOT NULL DEFAULT '0'  COMMENT '主单号,在组合/套餐商品拆单时会存在',
    push_delivery_status               tinyint(1)                                                 NULL DEFAULT '0'  COMMENT '是否推送物流信息 0.否 1.是',
    PRIMARY KEY (`order_id`),
    UNIQUE KEY `order_number_unique_ind` (`order_number`),
    UNIQUE KEY `order_number_userid_unique_ind` (`user_id`, `order_number`),
    KEY `data_statistics_idx` (`shop_id`, `order_number`, `is_payed`, `create_time`) USING BTREE COMMENT '数据统计索引',
    KEY `addr_order_id`(`addr_order_id`),
    KEY `idx_main_order_number`(`main_order_number`),
    KEY `dvy_id`(`dvy_id`)
) ENGINE = InnoDB
  DEFAULT CHARSET = utf8mb4
  COLLATE = 'utf8mb4_general_ci' COMMENT ='订单表';

/*Data for the table `tz_order` */

/*Table structure for table `tz_order_item` */

DROP TABLE IF EXISTS `tz_order_item`;

CREATE TABLE `tz_order_item`
(
    `order_item_id`                bigint unsigned                                               NOT NULL AUTO_INCREMENT COMMENT '订单项ID',
    `shop_id`                      bigint                                                        NOT NULL COMMENT '店铺id',
    `order_number`                 varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci  NOT NULL COMMENT '订单order_number',
    `prod_id`                      bigint unsigned                                               NOT NULL COMMENT '产品ID',
    `sku_id`                       bigint unsigned                                               NOT NULL COMMENT '产品SkuID',
    `category_id`                  bigint                                                                 DEFAULT NULL COMMENT '分类id',
    `prod_count`                   int                                                           NOT NULL DEFAULT '0' COMMENT '购物车产品个数',
    `prod_name`                    varchar(120) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '产品名称',
    `sku_name`                     varchar(120) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci          DEFAULT NULL COMMENT 'sku名称',
    `pic`                          varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '产品主图片路径',
    `price`                        decimal(15, 2)                                                NOT NULL COMMENT '产品价格',
    `user_id`                      varchar(36) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci  NOT NULL DEFAULT '' COMMENT '用户Id',
    `product_total_amount`         decimal(15, 2)                                                NOT NULL COMMENT '商品总金额',
    `rec_time`                     datetime                                                      NOT NULL COMMENT '购物时间',
    `comm_sts`                     int                                                           NOT NULL DEFAULT '0' COMMENT '评论状态： 0 未评价  1 已评价',
    `distribution_card_no`         varchar(36) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci           DEFAULT NULL COMMENT '推广员使用的推销卡号',
    `basket_date`                  datetime                                                               DEFAULT NULL COMMENT '加入购物车时间',
    `actual_total`                 decimal(15, 2)                                                         DEFAULT NULL COMMENT '商品实际金额 = 商品总金额 - 分摊的优惠金额',
    `share_reduce`                 decimal(15, 2)                                                NOT NULL COMMENT '分摊的优惠金额',
    `distribution_amount`          decimal(15, 2)                                                NOT NULL DEFAULT '0.00' COMMENT '推广员佣金',
    `distribution_parent_amount`   decimal(15, 2)                                                NOT NULL DEFAULT '0.00' COMMENT '上级推广员佣金',
    `score_amount`                 decimal(15, 2)                                                NOT NULL DEFAULT '0.00' COMMENT '积分优惠金额',
    `member_amount`                decimal(15, 2)                                                NOT NULL DEFAULT '0.00' COMMENT '等级优惠金额',
    `shop_coupon_amount`           decimal(15, 2)                                                NOT NULL DEFAULT '0.00' COMMENT '店铺优惠券优惠金额',
    `discount_amount`              decimal(15, 2)                                                NOT NULL DEFAULT '0.00' COMMENT '满减优惠金额',
    `combo_amount`                 decimal(15, 2)                                                NOT NULL DEFAULT '0.00' COMMENT '套餐优惠金额',
    `giveaway_amount`              decimal(15, 2)                                                NOT NULL DEFAULT '0.00' COMMENT '赠品金额',
    `platform_free_freight_amount` decimal(15, 2)                                                NOT NULL DEFAULT '0.00' COMMENT '会员运费减免金额',
    `free_freight_amount`          decimal(15, 2)                                                NOT NULL DEFAULT '0.00' COMMENT '店铺运费减免金额',
    `shop_change_free_amount`      decimal(15, 2)                                                NOT NULL DEFAULT '0.00' COMMENT '店铺改价优惠金额',
    `use_score`                    bigint                                                                 DEFAULT '0' COMMENT '使用积分',
    `gain_score`                   bigint                                                                 DEFAULT '0' COMMENT '获得积分',
    `status`                       int                                                                    DEFAULT '-1' COMMENT '-1待发货 0全部发货 其他数量为剩余待发货数量',
    `dvy_type`                     tinyint                                                                DEFAULT NULL COMMENT '单个orderItem的配送类型 1:快递 2:自提 3：无需快递 4:同城配送',
    `change_amount_version`        int                                                                    DEFAULT NULL COMMENT '支付金额版本号',
    `giveaway_order_item_id`       bigint                                                                 DEFAULT NULL COMMENT '赠送主订单项id',
    `is_giveaway`                  tinyint                                                       NOT NULL DEFAULT '0' COMMENT '是否有赠品',
    `giveaway_refund_status`       tinyint                                                                DEFAULT NULL COMMENT '赠品退款是否退回 0.不退回 1.退回',
    `pre_sell_time`                datetime                                                               DEFAULT NULL COMMENT '预售发货时间',
    `properties`                   varchar(2000)                                                          DEFAULT '' COMMENT '销售属性组合字符串 格式是p1:v1;p2:v2',
     `activity_id`                  bigint                                                              DEFAULT NULL COMMENT '活动id',
     `mold`                          tinyint                                                             NOT NULL COMMENT '商品类别 0.实物商品 1.虚拟商品 2.组合商品',
     `stock_point_id`               bigint                                                                  DEFAULT NULL COMMENT '库存点id',
     `activity_type`                tinyint                                                                 DEFAULT '0' COMMENT '活动类型 具体类型参考枚举类:OrderActivityType',
    PRIMARY KEY (`order_item_id`),
    KEY `order_number` (`order_number`),
    KEY `shop_id`(`shop_id`),
    KEY `sku_prod_id`(`sku_id`, `prod_id`),
    KEY `idx_activity_id`(`activity_id`),
    KEY `user_id`(`user_id`)
) ENGINE = InnoDB
  DEFAULT CHARSET = utf8mb4
  COLLATE = 'utf8mb4_general_ci' COMMENT ='订单项';

/*Data for the table `tz_order_item` */



/*Table structure for table `tz_order_settlement` */

DROP TABLE IF EXISTS `tz_order_settlement`;

CREATE TABLE `tz_order_settlement`
(
    `settlement_id` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT '支付结算单据ID',
    `pay_no`        varchar(36)    DEFAULT NULL COMMENT '支付单号',
    `order_number`  varchar(36)    DEFAULT NULL COMMENT 'order表中的订单号',
    `pay_type`      int(11)        DEFAULT NULL COMMENT '支付方式 1 微信支付 2 支付宝',
    `pay_score`     decimal(15, 2) DEFAULT NULL COMMENT '支付积分',
    `pay_amount`    decimal(15, 2) DEFAULT NULL COMMENT '支付金额',
    `user_id`       varchar(36)    DEFAULT NULL COMMENT '用户ID',
    `create_time`   datetime       DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
    `version`       int(11)        DEFAULT NULL COMMENT '版本号',
    `pay_status`    int(11)        DEFAULT NULL COMMENT '支付状态',
    PRIMARY KEY (`settlement_id`),
    UNIQUE KEY `primary_order_no` (`order_number`),
    KEY `user_id` (`user_id`),
    KEY `pay_no`(`pay_no`)
) ENGINE = InnoDB
  DEFAULT CHARSET = utf8mb4
  COLLATE = 'utf8mb4_general_ci' COMMENT ='订单结算表';

