/*Table structure for table `tz_prod` */

DROP TABLE IF EXISTS `tz_prod`;

CREATE TABLE `tz_prod`
(
    `prod_id`                  bigint UNSIGNED                                                NOT NULL AUTO_INCREMENT COMMENT '产品ID',
    `prod_name`                varchar(300) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci  NOT NULL DEFAULT '' COMMENT '商品名称',
    `shop_id`                  bigint                                                         NULL     DEFAULT NULL COMMENT '店铺id',
    `ori_price`                decimal(15, 2)                                                 NOT NULL DEFAULT 0.00 COMMENT '原价',
    `price`                    decimal(15, 2)                                                 NOT NULL DEFAULT 0.00 COMMENT '现价',
    `score_price`              int                                                            NULL     DEFAULT NULL COMMENT '商品积分价格',
    `brief`                    varchar(500) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci  NULL     DEFAULT '' COMMENT '简要描述,卖点等',
    `content`                  mediumtext CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci    NULL COMMENT '详细描述',
    `video`                    varchar(150) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci  NULL     DEFAULT NULL COMMENT '商品视频',
    `pic`                      varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci  NULL     DEFAULT NULL COMMENT '商品主图',
    `imgs`                     varchar(1000) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL     DEFAULT NULL COMMENT '商品图片，以,分割',
    `status`                   int                                                            NULL     DEFAULT 0 COMMENT '状态状态（-1:删除、0:商家下架、1:上架、2:违规下架、3:平台审核）',
    `shop_category_id`         bigint                                                         NULL     DEFAULT NULL COMMENT '在店铺当中的分类id',
    `category_id`              bigint                                                         NULL     DEFAULT NULL COMMENT '在平台当中的分类id',
    `delivery_mode`            json                                                           NULL COMMENT '配送方式json见TransportModeVO',
    `delivery_template_id`     BIGINT                                                         NULL COMMENT '运费模板id(0：统一包邮 -1：统一运费 其他：运费模板id)',
    `delivery_amount`          DECIMAL(15, 2)                                                 NULL     DEFAULT 0.00 COMMENT '统一运费的运费金额',
    `create_time`              datetime                                                       NULL     DEFAULT NULL COMMENT '录入时间',
    `update_time`              datetime                                                       NULL     DEFAULT NULL COMMENT '修改时间',
    `putaway_time`             datetime                                                       NULL     DEFAULT NULL COMMENT '上架时间',
    `version`                  int                                                            NULL     DEFAULT NULL COMMENT '版本 乐观锁',
    `prod_type`                tinyint                                                        NULL     DEFAULT 0 COMMENT '商品类型(0普通商品 1拼团 2秒杀 3积分)',
    `activity_id`              bigint                                                         NULL     DEFAULT NULL COMMENT '活动id(对应prod_type)',
    `brand_id`                 bigint                                                         NULL     DEFAULT NULL COMMENT '品牌Id',
    `pre_sell_status`          tinyint                                                        NULL     DEFAULT 0 COMMENT '预售状态 1：开启 0：未开启',
    `pre_sell_time`            datetime                                                       NULL     DEFAULT NULL COMMENT '预售发货时间',
    `mold`                     int(11)                                                                 DEFAULT 0 COMMENT '商品类别 0.实物商品 1. 虚拟商品 2.组合商品',
    `write_off_num`            int                                                                     DEFAULT NULL COMMENT '核销次数类型 -1.多次核销 0.无需核销 1.单次核销',
    `write_off_multiple_count` int                                                                     DEFAULT NULL COMMENT '核销次数 -1.无限次',
    `write_off_time`           int                                                                     DEFAULT NULL COMMENT '核销有效期 -1.长期有效 0.自定义  x.x天内有效',
    `write_off_start`          datetime                                                                DEFAULT NULL COMMENT '核销开始时间',
    `write_off_end`            datetime                                                                DEFAULT NULL COMMENT '核销结束时间',
    `is_refund`                tinyint                                                                 DEFAULT NULL COMMENT '是否可以退款 1.可以 0不可以',
    `virtual_remark`           json                                                                    DEFAULT NULL COMMENT '虚拟商城的留言备注',
    `use_lang`                 tinyint(4)                                                     NULL     DEFAULT 1 COMMENT '使用语言 0中文 1中英文',
    `is_top`                   TINYINT(4)                                                              DEFAULT '0' COMMENT '是否置顶，1.置顶 0.不置顶',
    `seq`                      INT(11)                                                                 DEFAULT '0' COMMENT '排序号',
    `is_all_entity`            INT                                                            DEFAULT NULL COMMENT '是否为全部实物商品的组合商品 1.是 0.否',
    PRIMARY KEY (`prod_id`) USING BTREE,
    INDEX `shop_id` (`shop_id`, `status`) USING BTREE,
    INDEX `k_category_id` (`category_id`) USING BTREE,
    INDEX `k_shop_category_id` (`shop_category_id`) USING BTREE,
    INDEX `k_activity_id` (`activity_id`) USING BTREE,
    INDEX `brand_id`(`brand_id`) USING BTREE,
    INDEX `delivery_template_id`(`delivery_template_id`) USING BTREE
) ENGINE = InnoDB
  CHARACTER SET = utf8mb4
  COLLATE = utf8mb4_general_ci COMMENT = '商品'
  ROW_FORMAT = Dynamic;


/*Table structure for table `tz_prod_extension` */

DROP TABLE IF EXISTS `tz_prod_extension`;

CREATE TABLE `tz_prod_extension`
(
    `prod_extend_id` bigint          NOT NULL AUTO_INCREMENT COMMENT '商品扩展信息表id',
    `create_time`    datetime        NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
