    `sold_num`       int unsigned    NOT NULL DEFAULT '0' COMMENT '销量',
    `water_sold_num` int unsigned    NOT NULL DEFAULT '0' COMMENT '注水销量',
    `comm_num` int(0) NOT NULL DEFAULT 0 COMMENT '评论数',
    `actual_stock` int(0) NOT NULL DEFAULT 0 COMMENT '实际库存',
