  DEFAULT CHARSET = utf8mb4
  COLLATE = 'utf8mb4_general_ci' COMMENT ='商品规格';

/*Table structure for table `tz_prod_prop_lang` */

DROP TABLE IF EXISTS `tz_prod_prop_lang`;

CREATE TABLE `tz_prod_prop_lang`
(
    `prop_id`   bigint(20) NOT NULL,
    `lang`      tinyint(4) NOT NULL,
    `prop_name` varchar(20) DEFAULT NULL COMMENT '属性名称',
    PRIMARY KEY (`prop_id`, `lang`)
) ENGINE = InnoDB
  DEFAULT CHARSET = utf8mb4 COMMENT ='商品规格国际化';

/*Table structure for table `tz_prod_prop_value` */

DROP TABLE IF EXISTS `tz_prod_prop_value`;

CREATE TABLE `tz_prod_prop_value`
(
    `value_id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '属性值ID',
    `prop_id`  bigint(20) DEFAULT NULL COMMENT '属性ID',
    PRIMARY KEY (`value_id`),
    KEY `prop_id` (`prop_id`)
) ENGINE = InnoDB
  DEFAULT CHARSET = utf8mb4
  COLLATE = 'utf8mb4_general_ci' COMMENT ='商品规格值';

/*Table structure for table `tz_prod_prop_value_lang` */

DROP TABLE IF EXISTS `tz_prod_prop_value_lang`;

CREATE TABLE `tz_prod_prop_value_lang`
(
    `value_id`   bigint(20) NOT NULL,
    `lang`       tinyint(4) NOT NULL,
    `prop_value` varchar(255) DEFAULT NULL COMMENT '属性值名称',
    PRIMARY KEY (`value_id`, `lang`)
) ENGINE = InnoDB
  DEFAULT CHARSET = utf8mb4 COMMENT ='商品规格值国际化';

DROP TABLE IF EXISTS `tz_prod_parameter`;

CREATE TABLE `tz_prod_parameter`
(
