/*Table structure for table `tz_shop_detail` */

DROP TABLE IF EXISTS `tz_shop_detail`;

CREATE TABLE `tz_shop_detail`
(
    `shop_id`               bigint(20)                                                    NOT NULL AUTO_INCREMENT COMMENT '店铺id',
    `shop_name`             varchar(50)                                                            DEFAULT NULL COMMENT '店铺名称(数字、中文，英文(可混合，不可有特殊字符)，可修改)、不唯一',
    `user_id`               varchar(36)                                                            DEFAULT NULL COMMENT '店长用户id',
    `intro`                 varchar(200)                                                           DEFAULT NULL COMMENT '店铺简介(可修改)',
    `shop_owner`            varchar(36)                                                            DEFAULT NULL COMMENT '店长',
    `mobile`                varchar(20)                                                            DEFAULT NULL COMMENT '店铺绑定的手机(登录账号：唯一)',
    `mail`                  varchar(255)                                                           DEFAULT NULL COMMENT '邮箱',
    `password`              varchar(100)                                                           DEFAULT NULL COMMENT '登录密码',
    `receive_mobile`        varchar(100)                                                           DEFAULT NULL COMMENT '接收短信号码',
    `tel`                   varchar(20)                                                            DEFAULT NULL COMMENT '店铺联系电话',
    `shop_logo`             varchar(200)                                                           DEFAULT NULL COMMENT '店铺logo(可修改)',
    `shop_status`           tinyint(4)                                                             DEFAULT NULL COMMENT '店铺状态(-1:已删除 0: 停业中 1:营业中 2:平台下线 3:平台下线待审核 4:开店申请中 5:开店申请待审核)',
    `create_time`           datetime                                                               DEFAULT NULL COMMENT '创建时间',
    `update_time`           datetime                                                               DEFAULT NULL COMMENT '更新时间',
    `is_distribution`       tinyint(4)                                                             DEFAULT NULL COMMENT '分销开关(0:开启 1:关闭)',
    `business_license`      varchar(200)                                                           DEFAULT NULL COMMENT '营业执照',
    `identity_card_front`   varchar(200)                                                           DEFAULT NULL COMMENT '身份证正面',
    `identity_card_later`   varchar(200)                                                           DEFAULT NULL COMMENT '身份证反面',
    `type`                  tinyint(4)                                                             DEFAULT '0' COMMENT '0普通店铺 1优选好店',
    `mobile_background_pic` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL     DEFAULT NULL COMMENT '店铺移动端背景图',
    `pc_background_pic`     varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL     DEFAULT NULL COMMENT '店铺pc背景图',
    `merchant_name`         varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci  NULL     DEFAULT NULL COMMENT '商家名称',
    `contract_start_time`   datetime                                                      NULL     DEFAULT NULL COMMENT '签约起始时间',
    `contract_end_time`     datetime                                                      NULL     DEFAULT NULL COMMENT '签约终止时间',
    `shop_score`            decimal(15, 2)                                                NOT NULL DEFAULT '0.00' COMMENT '店铺评分',
    `shop_sold_num`         BIGINT                                                                 DEFAULT '0' COMMENT '店铺销量',
    `is_platform` tinyint DEFAULT NULL COMMENT '是否为平台创建 1是0否',
    PRIMARY KEY (`shop_id`),
    UNIQUE KEY `mobile` (`mobile`),
    UNIQUE KEY `shop_user_id` (`user_id`)
) ENGINE = InnoDB
  DEFAULT CHARSET = utf8mb4
  COLLATE = 'utf8mb4_general_ci' COMMENT ='店铺详情';

