    `lng`         decimal(12, 6)               DEFAULT NULL COMMENT '经度',
    `lat`         decimal(12, 6)               DEFAULT NULL COMMENT '纬度',
    `mobile`      varchar(20)                  DEFAULT NULL COMMENT '手机',
    `status`      int(11)             NOT NULL COMMENT '状态,1正常，0无效',
    `common_addr` int(11)             NOT NULL DEFAULT '0' COMMENT '是否默认地址 1是',
    `create_time` datetime            NOT NULL COMMENT '建立时间',
    `version`     int(11)             NOT NULL DEFAULT '0' COMMENT '版本号',
    `update_time` datetime            NOT NULL COMMENT '更新时间',
    PRIMARY KEY (`addr_id`),
    KEY `user_id`(`user_id`)
) ENGINE = InnoDB
  DEFAULT CHARSET = utf8mb4
  COLLATE = 'utf8mb4_general_ci' COMMENT ='用户配送地址';

