DROP TABLE IF EXISTS `tz_currency_lang`;
CREATE TABLE `tz_currency_lang` (
    `id` bigint NOT NULL,
    `lang_id` int NOT NULL COMMENT '语言',
    `currency_name` varchar(30) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '语言名称',
    PRIMARY KEY (`id`,`lang_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='货币语言表';




DROP TABLE IF EXISTS `tz_lang`;
CREATE TABLE `tz_lang`  (
  `lang_id` int(0) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `name` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT NULL COMMENT '语言名称',
  `lang` int(0) NULL DEFAULT NULL COMMENT '语言编号',
  `language` varchar(5) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT NULL COMMENT '语言代码',
  `master` tinyint(1) NULL DEFAULT NULL COMMENT '是否默认',
  `hide` tinyint(1) NULL DEFAULT NULL COMMENT '是否隐藏',
  `remark` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`lang_id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_unicode_ci ROW_FORMAT = Dynamic;



DROP TABLE IF EXISTS `tz_currency`;
CREATE TABLE `tz_currency` (
                               `id` bigint unsigned NOT NULL AUTO_INCREMENT COMMENT 'ID',
                               `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
                               `update_time` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
                               `currency_code` varchar(10) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '货币编码',
                               `symbol` varchar(10) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '货币符号',
                               `exchange_rate` decimal(15,2) DEFAULT '0.00' COMMENT '汇率值',
                               `status` int DEFAULT '0' COMMENT '状态 1.启用 0.禁用',
                               `default_currency` tinyint DEFAULT '0' COMMENT '是否默认货币',
                               PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=26 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci COMMENT='货币汇率表';













DROP TABLE IF EXISTS `tz_sys_log`;

CREATE TABLE `tz_sys_log` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `username` varchar(50) DEFAULT NULL COMMENT '用户名',
  `operation` varchar(50) DEFAULT NULL COMMENT '用户操作',
  `method` varchar(200) DEFAULT NULL COMMENT '请求方法',
  `params` varchar(5000) DEFAULT NULL COMMENT '请求参数',
  `time` bigint(20) NOT NULL COMMENT '执行时长(毫秒)',
  `ip` varchar(64) DEFAULT NULL COMMENT 'IP地址',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=846 DEFAULT CHARSET=utf8 COMMENT='系统日志';
